    <div className='Nav'>
       <Menu/>
      <img src='/IMAGES/logo.png' width="82px"/>
      <ul>
   
   
     <li><Link   to="/" style={linkStyle?{
        textDecoration: "none",
        color:"white",
        fontSize:20,
    }:{
